import React from 'react';
import styled from 'styled-components';
import LogoImage from "../img/logo.png";

const Container = styled.div`
flex: 1;
background-color: #202020;
height: 100vh;
color: white;
`;

const Wrapper = styled.div`
   padding: 18px 26px;
`

const Logo = styled.div`
   display: flex;
   align-items: center;

   font-weight: bold;
`
const Img = styled.div`
   height: 25px;

`


const Menu = () => {
  return (
    <Container>
      <Wrapper><Logo>
        <Img src={LogoImage}>
        Infiniview
        </Img>
        </Logo>
      </Wrapper>
      </Container>
  )
}

export default Menu
